with open("Task_Day19.txt","r") as infile:
    lines = infile.readlines()

input_line = ""

element = []
for line in lines:
    key, x, value = line.split()
    if key in element:
        continue
    else:
        element.append(key)


X = 0
for each in element:
    X += input_line.count(each)

Y = input_line.count("Y")
print(X - Y - 1)
